  public TUVienna.CS_CUP.Runtime.Symbol debug_next_token() {
    TUVienna.CS_CUP.Runtime.Symbol s = next_token();
    Console.WriteLine( " --{0}--{1}--",
      
yytext(), getTokenName(s.sym));
    return s;
  }

